import React, { useReducer } from 'react';

const initialState = {
  count: 0,
};
const reducer = (curr_state, action) => {
  switch (action.type) {
    case 'increment':
      return { count: curr_state.count + 1 };
    default:
      return curr_state;
  }
};

function Parent() {
  const [newState, dispatch] = useReducer(reducer, initialState);
  return <div>count : {newState.count}</div>;
}

export default Parent;
